In C, both `static` and `register` are storage class specifiers that affect the scope, lifetime, and storage of variables. Here's a detailed explanation of each:

### Static Variables

1. **Scope and Lifetime**:
   - **Local Static Variables**: When a variable is declared `static` inside a function, it retains its value between function calls. Its lifetime is the entire duration of the program, but its scope is limited to the function in which it is declared.
   - **Global Static Variables**: When a variable is declared `static` outside of any function, it has file scope, meaning it can only be accessed within the file it is declared in. Its lifetime is the entire duration of the program.

2. **Initialization**:
   - Static variables are initialized only once, at the start of the program. If not explicitly initialized, they are initialized to zero.

3. **Memory Allocation**:
   - Static variables are stored in the data segment of the memory, not on the stack.

4. **Example**:
   ```c
   #include <stdio.h>

   void func() {
       static int count = 0;
       count++;
       printf("Count: %d\n", count);
   }

   int main() {
       func(); // Output: Count: 1
       func(); // Output: Count: 2
       return 0;
   }
   ```

### Register Variables

1. **Scope and Lifetime**:
   - `register` variables are local to the block in which they are declared. Their lifetime is the duration of the block.

